import XCTest

class KMP: XCTestCase {
    
    override func setUp() {
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }
    
    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
    }
    
    private func getNext(string: String) -> [Int] {
        precondition(string.count > 0)
        let strArray = string.map { $0 }
        var next = [-1]
        var i = 0
        var j = -1
        while i < strArray.count {
            if j == -1 || strArray[i] == strArray[j] {
                j += 1
                i += 1
                next.append(j)
            } else {
                j = next[j]
            }
        }
        next.removeLast()
        return next
    }
    
    private func kmpSearch(_ haystack: String, _ needle: String) -> Int {
        if needle.count == 0 { return 0 }
        if haystack.count == 0 { return -1 }
        if haystack.count < needle.count { return -1 }
        
        let next = getNext(string: needle)
        let strArray = haystack.map { $0 }
        let patternArray = needle.map { $0 }
        var i = 0
        var j = 0
        
        while i < strArray.count && j < patternArray.count {
            print(i, j)
            if j == -1 || strArray[i] == patternArray[j] {
                i += 1
                j += 1
            } else {
                j = next[j]
            }
        }
        if j == patternArray.count {
            return i - j
        } else {
            return -1
        }
    }
    
    func testGetNext() {
        XCTAssertEqual(getNext(string: "abababca"), [-1, 0,0,1,2,3,4,0])
        XCTAssertEqual(getNext(string: "ll"), [-1, 0])
        XCTAssertEqual(getNext(string: "abcdabd"), [-1, 0,0,0,0,1,2])
        XCTAssertEqual(getNext(string: "issipi"), [-1, 0,0,0,1,0])
        XCTAssertEqual(getNext(string: "aabaaac"), [-1, 0, 1, 0, 1, 2, 2])
    }
    
    func testKMP() {
        XCTAssertEqual(kmpSearch("hello", "ll"), 2)
        XCTAssertEqual(kmpSearch("aaaaa", "bba"), -1)
        XCTAssertEqual(kmpSearch("aaa", "aaaa"), -1)
        XCTAssertEqual(kmpSearch("mississippi", "mississippi"), 0)
        XCTAssertEqual(kmpSearch("mississippi", "issip"), 4)
        XCTAssertEqual(kmpSearch("mississippi", "is"), 1)
        XCTAssertEqual(kmpSearch("mississippi", "issipi"), -1)
        XCTAssertEqual(kmpSearch("mississippi", "pi"), 9)
        XCTAssertEqual(kmpSearch("babba", "bbb"), -1)
        XCTAssertEqual(kmpSearch("aabaaabaaac", "aabaaac"), 4)
        XCTAssertEqual(kmpSearch("",  ""), 0)
    }
}
